import { Link } from "react-router-dom";
import { useState } from "react";
import { getUserSession } from "../utils/open-sf-utils";
import moment from "moment";
import axios from "axios";

function MainHome() {
  var name = "홍길동";
  var position = "대리";

  const [userInfo, setUserInfo] = useState("");
  const [userSession, setUserSession] = useState(getUserSession());

  console.log(userSession);
  console.log(userSession.data);
  // const getUserSession = () => {
  //   let url = "/userinfo";
  //   let result = "";
  //   axios.get(url, {}).then((res) => {
  //     result = res;
  //     console.log(result);
  //     return result;
  //   });
  // };
  console.log(moment());
  return (
    <div className="home_box">
      <div className="home_header">
        <div className="profile_box">
          <div className="profile_pic" onClick={getUserSession}></div>
          <div className="profile_txt_box">
            <div className="profile_name">{name}</div>
            <div className="profile_position">{position}</div>
          </div>
        </div>

        <div className="home_body">
          <div className="home_body_box">
            <table className="tbl_home_body">
              <thead>
                <tr>
                  <td>
                    <Link to="/Calendar">
                      <img src={require("../images/icn_calendar.png")}></img>
                      <div className="home_li_txt">캘린더</div>
                    </Link>
                  </td>
                  <td>
                    <Link to="/Board">
                      <img src={require("../images/icn_board.png")}></img>
                      <div className="home_li_txt">게시판</div>
                    </Link>
                  </td>
                </tr>
              </thead>
            </table>
          </div>
        </div>
        <div className="home_footer">
          <div className="home_footer_box">2022 @ ioss.co.kr | tykim</div>
        </div>
      </div>
    </div>
  );
}
export default MainHome;
